    false,nt"url": null,nt"notes": "The HOT program makes repeated observations
    of the physics, biology and chemistry at a site approximately 100 km north of Oahu,
    Hawaii. The program began in 1988. Two stations are visited about once a month:
    Kahe Point (Station 1: 21.34N, 158.27W) and Station ALOHA (Station 2: 22.75N, 158W).
    Various other stations are made intermittently in support of similar research objectives
    or mooring deployments.nnThis NODC Accession contains thermosalinograph data for
    HOT cruises 249-258 during 2013. Bottle and CTD data from the same cruises are available
    in separate NODC accessions, 0125579 and 0125647, respectively. Historic HOT cruises
    are also available.",nt"license_title": null,nt"extras": [{ntt"key":
